import React, {Component} from 'react'
import './cadastro.css'

class DinamicSel extends Component{

  constructor(props){
    super(props)

    // this.iteratorSel = this.iteratorSel.bind(this)
  }

  iteratorSel(){

    const squad = [
      'Wilson Caixa',
      'Biano Oliveira',
      'Renato Fermiza'
    ]

    const arrOpt = () => squad.map(function(name, i){
      return ` <option value=${i}>${name}</option>`
    })
    console.log(this.iteratorSel())
  }

  render(){    
    return(      
      <div className="form-group col-md-4">
      <label name="squadInput">Equipe</label>
      <select  defaultValue={'DEFAULT'} id="squadInput" className="form-control">
        <option value='DEFAULT' selected>Escolher...</option>  
        {this.iteratorSel()}
      </select>
    </div>
    )
  }
}


const cadastro = () =>{
  return(
    <div className='Form-boa'>
      <form>
        <h2>Cadastrar Participante</h2>
        <hr></hr>
        <div className="form-row">
          <div className="form-group col-md-6">
            <label name="inputName">Nome</label>
            <input type="text" className="form-control" id="inputName" placeholder="Nome" />
          </div>
          <div className="form-group col-md-6">
            <label name="inputPassword4">Senha</label>
            <input type="password" className="form-control" id="inputPassword4" placeholder="Senha" />
          </div>
        </div>
        <div className="form-row">
          <div className="form-group col-md-6">
            <label name="sortIten">Iten da Sorte</label>
            <input type="text" className="form-control" id="sortIten" placeholder="Mandinga pra dar sorte" />          
          </div>
          <DinamicSel />
        </div>       
        <button type="submit" className="btn btn-primary">Cadastrar</button>
      </form>
</div>
  )
}

export default cadastro
